import React from "react";
import './Modals.scss'

const Modals = ({children, isOpen, closeModal}) => {

    return(
        <article className={`modal ${isOpen && "is-open"}`}>

            <div className="modal-container">
                <button className="modal-close">X</button>
                {children}
            </div>
        </article>
    )
}

export default Modals;
